import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom';
import './index.css';
import App from './App';

const temp = () => (
    <div>
      For Businesses
    </div>
)

const routes = (
  <BrowserRouter>
    <div>
      <Route path="/" component={App} exact={true}/>
      <Route path="/businesses" component={temp}/>
      <Route path="/workers" component={temp}/>
    </div>
  </BrowserRouter>
);

ReactDOM.render(
  routes,
  document.getElementById('root')
);
